import React from "react";

type Props = {};

const card = (props: Props) => {
  return (
    <div className="card">
      <img src="cute dog.jpg" alt="image" />

      <div className="details">
        <h2>Cute Dog</h2>
        <p>This is a very cute dog.</p>
      </div>

      <p className="info">
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Eius, illo.
      </p>
    </div>
  );
};

export default card;
